import React from "react";
import { Link } from "react-router-dom";
import { useAuth } from "../context/AuthContext";

const Navbar = () => {
  const { user, logout } = useAuth();

  return (
    <nav className="bg-gray-800 text-white p-4 flex justify-between">
      <div className="space-x-4">
        <Link to="/" className="hover:underline">Thực đơn</Link>
        <Link to="/calorie" className="hover:underline">Ước lượng calo</Link>
        <Link to="/workout" className="hover:underline">Kế hoạch tập luyện</Link>
      </div>
      <div>
        {user ? (
          <button onClick={logout} className="hover:underline">Đăng xuất</button>
        ) : (
          <>
            <Link to="/login" className="mr-4 hover:underline">Đăng nhập</Link>
            <Link to="/register" className="hover:underline">Đăng ký</Link>
          </>
        )}
      </div>
    </nav>
  );
};

export default Navbar;
